#define COLORPIP_SELECTOR(tgt) do { \
 if (fg == COLORMAIN_WHITE && bg == COLORMAIN_GREEN) \
  tgt = & byte2runpip_COLORPIP_WHITE_COLORPIP_GREEN; \
 else if (fg == COLORMAIN_WHITE && bg == COLORMAIN_DARKGREEN) \
  tgt = & byte2runpip_COLORPIP_WHITE_COLORPIP_DARKGREEN; \
 else if (fg == COLORMAIN_BLACK && bg == COLORMAIN_DARKGREEN) \
  tgt = & byte2runpip_COLORPIP_BLACK_COLORPIP_DARKGREEN; \
 else if (fg == COLORMAIN_YELLOW && bg == COLORMAIN_BLACK) \
  tgt = & byte2runpip_COLORPIP_YELLOW_COLORPIP_BLACK; \
 else if (fg == COLORMAIN_BLACK && bg == COLORMAIN_GREEN) \
  tgt = & byte2runpip_COLORPIP_BLACK_COLORPIP_GREEN; \
 else if (fg == COLORMAIN_BLACK && bg == COLORMAIN_RED) \
  tgt = & byte2runpip_COLORPIP_BLACK_COLORPIP_RED; \
 else if (fg == COLORMAIN_GREEN && bg == COLORMAIN_BLACK) \
  tgt = & byte2runpip_COLORPIP_GREEN_COLORPIP_BLACK; \
 else if (fg == COLORMAIN_RED && bg == COLORMAIN_BLACK) \
  tgt = & byte2runpip_COLORPIP_RED_COLORPIP_BLACK; \
 else \
  tgt = & byte2runpip_COLORPIP_WHITE_COLORPIP_BLACK; \
} while (0)
